interface OutlineProps {
    frame: number,
}

interface ModifierNode {
    x1: number,
    x2: number,
    y1: number,
    y2: number,
}

interface LineNode extends ModifierNode {
    centerX: number,
    centerY: number,
}

interface TransitionLineNode {
    from: LineNode,
    to: LineNode,
    offset: number,
    duration: number,
}

// Дозаполнение рандомными линиями
const duplicateLines = (original: LineNode[], targetCount: number) => {
    const out = [];
    while (out.length < targetCount - original.length) {
        const idx = Math.floor(Math.random() * original.length);
        out.push({
            ...original[idx],
        });
    }
    return out;
};

