// Трансформированные вектора в линии
const TRANSFORMED_LINES = SLIDE_VECTORS.map((vectorArray) => {
    const lines: LineNode[] = [];
    for (const vector of vectorArray) {
        const rawLines = parseSVG(vector);
        makeAbsolute(rawLines);
        for (const cmd of rawLines) {
            if (['L', 'H', 'V'].includes(cmd.code)) {
                const raw = cmd as any;
                lines.push({
                    x1: raw.x0,
                    y1: raw.y0,
                    x2: raw.x,
                    y2: raw.y,
                    centerX: (raw.x0 + raw.x) / 2.0,
                    centerY: (raw.y0 + raw.y) / 2.0,
                });
            }
        }
    }
    return lines;
});

const MORPH_GROUPS: TransitionLineNode[][] = [];
for (let i = 0; i < TRANSFORMED_LINES.length - 1; i++) {
    const from = [...TRANSFORMED_LINES[i]];
    const to = [...TRANSFORMED_LINES[i + 1]];
    const maxLines = Math.max(from.length, to.length);
    if (from.length < maxLines) {
        from.push(...duplicateLines(from, maxLines));
    }
    if (to.length < maxLines) {
        to.push(...duplicateLines(to, maxLines));
    }

    // Поиск ближайших к друг другу линий
    const toClone = [...to];
    const out: TransitionLineNode[] = [];
    let minBound = Infinity;
    let maxBound = Infinity;
    for (const l of from) {
        let dist = Infinity;
        let idx = 0;
        for (let h = 0; h < toClone.length; h++) {
            const lt = toClone[h];
            const thisDist = (lt.centerX - l.centerX) ** 2 + (lt.centerY - l.centerY) ** 2;
            if (thisDist < dist) {
                dist = thisDist;
                idx = h;
            }
        }

        // Создание ноды и удаление из клона
        const time = Math.random() * 0.5 + 0.3;
        const deltaPos = (l.centerX + l.centerY) / 2000.0;
        minBound = Math.min(deltaPos, minBound);
        maxBound = Math.max(deltaPos, maxBound);
        out.push({
            from: l,
            to: { ...toClone[idx] },
            offset: 0,
            duration: time,
        });
        toClone.splice(idx, 1);
    }
    out.map((node) => {
        const deltaPos = (node.from.centerX + node.from.centerY) / 2000.0;
        node.offset = ((deltaPos - minBound) / (maxBound - minBound)) * (1.0 - node.duration - 0.2) + Math.random() * 0.2;
        // node.offset = Math.random() * (1.0 - node.duration);
        return node;
    });
    MORPH_GROUPS.push(out);
}

export function OutlineGraphics({ frame }: OutlineProps) {
    const frameInt = Math.floor(frame);
    const lines: ModifierNode[] = [];
    if (frame >= 1) {
        if ((frame % 1.0) === 0) {
            for (const l of TRANSFORMED_LINES[frameInt - 1]) {
                lines.push(l);
            }
        } else {
            for (const g of MORPH_GROUPS[frameInt - 1]) {
                const x = Math.min(Math.max(((frame % 1.0) - g.offset) / g.duration, 0.0), 1.0);
                const tween = x < 0.5 ? 4 * x * x * x : 1 - (-2 * x + 2) ** 3 / 2;
                const x1 = g.from.x1 + (g.to.x1 - g.from.x1) * tween;
                const y1 = g.from.y1 + (g.to.y1 - g.from.y1) * tween;
                const x2 = g.from.x2 + (g.to.x2 - g.from.x2) * tween;
                const y2 = g.from.y2 + (g.to.y2 - g.from.y2) * tween;
                lines.push({
                    x1, x2, y1, y2,
                });
            }
        }
    } else if (frame > 0) {
        for (const l of TRANSFORMED_LINES[0]) {
            const tx = l.x1 + (l.x2 - l.x1) * frame;
            const ty = l.y1 + (l.y2 - l.y1) * frame;
            lines.push({
                x1: l.x1,
                x2: tx,
                y1: l.y1,
                y2: ty,
            });
        }
    }

    let path = '';
    for (const l of lines) {
        path += `M${l.x1} ${l.y1} `;
        if (l.x2 === l.x1) {
            path += `V${l.y2} `;
        } else if (l.y1 === l.y2) {
            path += `H${l.x2} `;
        } else {
            path += `L${l.x2} ${l.y2} `;
        }
    }

    return (
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1000 1000" fill="none">
            <path d={path} stroke="#555565" />
        </svg>
    );
}
